<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>USA Time Zones</title>
  <a href="{{ url_for('dashboard') }}" class="back-icon">Back</a>
  <link rel="icon" href="{{ url_for('static', filename='IFTA5458.png') }}" type="image/png" />
  <link href="https://fonts.googleapis.com/css2?family=Roboto+Mono:wght@400;700&display=swap" rel="stylesheet">
  
  <style>
    body {
      margin: 0;
      font-family: 'Segoe UI', sans-serif;
      background: linear-gradient(to right, #162a3f, #8d9dab, #162a3f);
      color: #ecf0f1;
      text-align: center;
      font-size: 16px;
      transition: background 0.5s ease-in-out;
    }

    h1 {
      font-size: 2.5rem;
      margin: 10px 0 10px;
      text-transform: uppercase;
      letter-spacing: 2px;
    }

    .timezones {
      position: relative;
      width: 100%;
      max-width: 1200px; /* Limiting width */
      margin: 0 auto 10px;
      display: flex;
      justify-content: space-between;
      padding: 5px;
      background-color: rgba(173, 216, 230, 0.7);
      overflow-x: auto;
      box-sizing: border-box;
      gap: 4px;
      flex-wrap: wrap; /* Allow wrapping on small screens */
    }

    .timezone {
      flex: 1;
      display: flex;
      flex-direction: column;
      align-items: center;
      padding: 5px 0;
      background: linear-gradient(145deg, #0f2027 0%, #203a43 60%, rgba(0, 0, 0, 0) 100%);
      border: 2px solid #4d728a;
      border-radius: 6px;
      box-shadow: 0 0 6px rgba(0, 255, 255, 0.4);
      margin: 0;
      transition: transform 0.3s ease, background 0.3s ease;
    }

    .timezone:hover {
      transform: scale(1.05);
      background: linear-gradient(145deg, #203a43 0%, #0f2027 60%, rgba(0, 0, 0, 0) 100%);
      box-shadow: 0 0 10px rgba(0, 255, 255, 0.6);
    }

    .timezone span:first-child {
      font-weight: bold;
      font-size: 18px;
      margin-bottom: 0px;
      text-transform: uppercase;
    }

    .timezone span:last-child {
      font-family: 'Roboto Mono', monospace;
      font-size: 26px;
      font-weight: bold;
      text-shadow: 0 0 8px #000;
      transition: opacity 0.3s ease-in-out;
    }

    .timezone span.updated {
      opacity: 0;
    }

    svg {
      width: 100%;
      max-width: 1200px;
      height: auto;
      display: block;
      margin: 0 auto;
      border-radius: 12px;
      box-shadow: 0 0 20px rgba(0, 0, 0, 0.6);
    }

.back-icon {
  position: absolute;
  top: 20px;
  left: 20px;
  background-color: #151c29;
  color: white;
  padding: 10px 20px;
  border-radius: 12px;
  font-weight: 600;
  text-decoration: none;
  display: flex;
  align-items: center;
  transition: all 0.3s ease;
  outline: none; /* Remove default outline */
}

.back-icon:hover {
  background-color: #000000;
  transform: scale(1.05); /* Slight scale up effect */
}

.back-icon:focus {
  outline: 2px solid #fff; /* White outline when focused */
  background-color: #2c3e50; /* Slightly different background color on focus */
}

.back-icon:active {
  transform: scale(0.98); /* Slight scale down effect when clicked */
}

.back-icon::before {
  content: "‚Üê";
  font-size: 18px;
  margin-right: 8px;
}

    @media (max-width: 768px) {
      .timezones {
        flex-direction: column;
        align-items: center;
      }
    }

    .back-icon:focus {
      outline: 2px solid #fff;
    }

  </style>
</head>

<g id="timezone-labels" font-family="Segoe UI, sans-serif" font-weight="bold" text-anchor="middle">
  <text x="150" y="-50" font-size="30" fill="url(#_Linear1)" style="filter: drop-shadow(0 0 4px #38bdf8);">
    PACIFIC
  </text>
  <text x="455" y="-50" font-size="30" fill="url(#_Linear2)" style="filter: drop-shadow(0 0 4px #7dd3fc);">
    MOUNTAIN
  </text>
  <text x="780" y="-50" font-size="30" fill="url(#_Linear3)" style="filter: drop-shadow(0 0 4px #22d3ee);">
    CENTRAL
  </text>
  <text x="1090" y="-50" font-size="30" fill="url(#_Linear4)" style="filter: drop-shadow(0 0 4px #60a5fa);">

  </text>
</g>
    
    </svg>

  <script>
    function updateTime() {
      const now = new Date();
      const timeZones = {
        pacific: 'America/Los_Angeles',
        mountain: 'America/Denver',
        central: 'America/Chicago',
        eastern: 'America/New_York'
      };

      for (const [id, zone] of Object.entries(timeZones)) {
        const time = new Intl.DateTimeFormat('en-US', {
          hour: '2-digit',
          minute: '2-digit',
          second: '2-digit',
          hour12: false,
          timeZone: zone
        }).format(now);

        // Fade out the current time, update, and fade in the new time
        const timezoneElement = document.getElementById(id);
        timezoneElement.classList.add('updated');

        setTimeout(() => {
          timezoneElement.textContent = time;
          timezoneElement.classList.remove('updated');
        }, 300);  // Match this with the CSS transition time
      }
    }

    updateTime();
    setInterval(updateTime, 1000);
  </script>
